import logo from './logo.svg';
import png from './nature.jpg';
import './App.css';
import Navbar from './Navbar';
import Home from './Home';
import { useState } from 'react';
import {Routes,Route,Link} from 'react-router-dom';
import Userprofile from './Userprofile';
import Tablelist from './Tablelist';

function App() {
  return (
    <>
    <div className='flex relative '>
     <div className='flex-col fixed'>
       <Navbar/>
     </div>
    <div className='bg-red-400 w-screen ml-46'>
    <div className='flex py-5 px-8'>
    <span className='text-xl'>Dashboard</span>
    <div className='ml-auto flex space-x-10'>
    <input type='text' placeholder='sreach' className='px-5 bg-slate-200'></input>

    <a href=''><svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke-width="1.5" stroke="currentColor" class="size-6">
    <path stroke-linecap="round" stroke-linejoin="round" d="m2.25 12 8.954-8.955c.44-.439 1.152-.439 1.591 0L21.75 12M4.5 9.75v10.125c0 .621.504 1.125 1.125 1.125H9.75v-4.875c0-.621.504-1.125 1.125-1.125h2.25c.621 0 1.125.504 1.125 1.125V21h4.125c.621 0 1.125-.504 1.125-1.125V9.75M8.25 21h8.25" />
    </svg></a>
    <a href=''><svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth="1.5" stroke="currentColor" className="size-6">
    <path strokeLinecap="round" strokeLinejoin="round" d="M14.857 17.082a23.848 23.848 0 0 0 5.454-1.31A8.967 8.967 0 0 1 18 9.75V9A6 6 0 0 0 6 9v.75a8.967 8.967 0 0 1-2.312 6.022c1.733.64 3.56 1.085 5.455 1.31m5.714 0a24.255 24.255 0 0 1-5.714 0m5.714 0a3 3 0 1 1-5.714 0" />
    </svg></a>
    <a href=''><svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke-width="1.5" stroke="currentColor" class="size-6">
    <path stroke-linecap="round" stroke-linejoin="round" d="M17.982 18.725A7.488 7.488 0 0 0 12 15.75a7.488 7.488 0 0 0-5.982 2.975m11.963 0a9 9 0 1 0-11.963 0m11.963 0A8.966 8.966 0 0 1 12 21a8.966 8.966 0 0 1-5.982-2.275M15 9.75a3 3 0 1 1-6 0 3 3 0 0 1 6 0Z" />
    </svg>
    </a>  
    </div>
    </div>
    {/*<div className='ml-56 inline-block'>
     <Routes>
      <Route path='/' element={<Home/>}/>
      <Route path='/userprofile' element={<Userprofile/>}/>
      <Route path='/tablelist' element={<Tablelist/>}/>
    </Routes>
     </div>*/}
     </div>
    </div>

    </>

  );
}
export default App;
